import Link from "next/link";
import styled from "styled-components";
import Button from "../Button/Button";
import { Flex } from "../Flex/Flex";
import { Title } from "../Title/Title";

const NavbarOption = styled.a`
  text-decoration: none;
  border: none;
  font-weight: bold;
  line-height: 18px;
  transition: all 350ms;

  &:hover {
    border-bottom: 2px solid red;
  }
`;

const Navbar = () => (
  <Flex w={1} alignItems="space-between">
    <Title>Elefante</Title>
    <Flex w={0.5} alignItems="center" p={2}>
      <Flex p={2}>
        <Link href="/">
          <NavbarOption>Home</NavbarOption>
        </Link>
      </Flex>
      <Flex>
        <Link href="/recursos">
          <NavbarOption>Recursos</NavbarOption>
        </Link>
      </Flex>
      <Flex>
        <Link href="/precos">
          <NavbarOption>Pre√ßos</NavbarOption>
        </Link>
      </Flex>
      <Flex>
        <Link href="/about">
          <NavbarOption>Ajuda</NavbarOption>
        </Link>
      </Flex>
    </Flex>
    <style jsx>{`
      ul {
        background: #333;
        color: #fff;
        list-style: none;
        display: flex;
      }

      ul li {
        font-size: 18px;
        margin-right: 20px;
      }
    `}</style>
  </Flex>
);

export default Navbar;
